import { NavLink } from "react-router-dom";
import "./Dialogs.css";

const DialogItem = (props) => {
  return (
    <div className="dialog active">
      <NavLink to={"/dialogs/" + props.id}>{props.name}</NavLink>
    </div>
  );
};

const Dialogs = (props) => {
  return (
    <div className="dialogs">
      <div className="dialogsItems">
        <DialogItem name="Maria" id="1" />
        <DialogItem name="Anna" id="2" />
        <DialogItem name="Ani" id="3" />
        <DialogItem name="Armen" id="4" />
        <DialogItem name="Artak" id="5" />
        <DialogItem name="Argam" id="6" />

        <div className="dialog">
          <NavLink to="/dialogs/2">Anna</NavLink>
        </div>
        <div className="dialog">
          <NavLink to="/dialogs/3">Ani</NavLink>
        </div>
        <div className="dialog">
          <NavLink to="/dialogs/4">Armen</NavLink>
        </div>
        <div className="dialog">
          <NavLink to="/dialogs/5">Artak</NavLink>
        </div>
        <div className="dialog">
          <NavLink to="/dialogs/6">Argam</NavLink>
        </div>
      </div>
      <div className="messages">
        <div className="message">Hi</div>
        <div className="message">How are you</div>
        <div className="message">Lalala</div>
      </div>
    </div>
  );
};

export default Dialogs;
